import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';
import { Link } from "react-router-dom";

import img1 from '../../images/events/cme-talk-for-doctors-the-sporting-knee/subimg1.jpg';
import img2 from '../../images/events/orthopaedic-public-forum-at-khoo-teck-puat-hospital/img1.jpg';
import img3 from '../../images/events/singapore-allergy-and-rhinology-conference-2018/image1.jpg';
import img4 from '../../images/events/update-on-allergic-rhinitis-treatments/img1.jpg';
import img5 from '../../images/events/respiratory-tract-infection-with-focus-on-bronchitis-and-phytotreatment-options/img1.png';
import img6 from '../../images/events/addressing-the-unmet-needs-in-the-management-of-allergic-rhinitis/img1.jpg';
import img7 from '../../images/events/orthopaedic-public-forum-in-tamil/schedule.jpg';
import img8 from '../../images/events/viartrils-roadshow/img1.jpg';
import img9 from '../../images/events/lunch-symposium/img1.jpg';
import img10 from '../../images/events/legalon-blitz/img1.jpg';
import img11 from '../../images/events/sports-medicine-shoulder-tendinopathy-course-for-GP/img1.jpg';
import img12 from '../../images/events/cme-talk-managing-knee-pain-how-does-the-evidence-stand-up/img1.jpg';
import img13 from '../../images/events/prospan-guardian-retail-assistant-pharmacists-product-training/img1.jpg';
import img14 from '../../images/events/viartrils-guardian-retail-assistant-pharmacists-product-training/img1.jpg';
import img15 from '../../images/events/health-and-you-2015/img1.jpg';
import img16 from '../../images/events/public-education-talk-bone-and-joint-health/img1.jpg';
import img17 from '../../images/events/osteoarthritis-and-cancer-risk-and-treatment-options/img1.jpg';
import img18 from '../../images/events/fatty-liver-disease/img1.jpg';
import img19 from '../../images/events/are-you-suffering-from-knee-pain/img2.jpg';
import img20 from '../../images/events/health-and-you-2014/img1.jpg';

function PastEvents() {


    const events = [
        {
            id:1, 
            name:"CME Talk for Doctors: The Sporting Knee", 
            image: img1,
        },
        {
            id:2, 
            name:"Orthopaedic Public Forum at Khoo Teck Puat Hospital (in Mandarin)", 
            image: img2,
        },
        {
            id:3, 
            name:"Singapore Allergy & Rhinology Conference 2018", 
            image: img3,
        },
        {
            id:4, 
            name:"Update on Allergic Rhinitis Treatments by Dr Leong Jern Lin", 
            image: img4,
        },
        {
            id:5, 
            name:"Respiratory Tract Infection with Focus on Bronchitis and Phyto-Treatment Options", 
            image: img5,
        },
        {
            id:6, 
            name:"Addressing the Unmet Needs in the Management of Allergic Rhinitis", 
            image: img6,
        },
        {
            id:7, 
            name:"Orthopaedic Public Forum in Tamil", 
            image: img7,
        },
        {
            id:8, 
            name:"Viartril-S Roadshow", 
            image: img8,
        },
        {
            id:9, 
            name:"Lunch Symposium by Professor Jean-Yves Reginster M.D.,PH.D.", 
            image: img9,
        },
        {
            id:10, 
            name:"Legalon blitz with Team Pharmline", 
            image: img10,
        },
        {
            id:11, 
            name:"Sports Medicine Shoulder Tendinopathy Course for General Practitioners", 
            image: img11,
        },
        {
            id:12, 
            name:"CME Talk: Managing Knee Pain – How does the evidence stand up?", 
            image: img12,
        },
        {
            id:13, 
            name:"Prospan – Guardian retail assistant pharmacists product training", 
            image: img13,
        },
        {
            id:14, 
            name:"Viartril-S – Guardian retail assistant pharmacists product training", 
            image: img14,
        },
        {
            id:15, 
            name:"Health & YOU 2015", 
            image: img15,
        },
        {
            id:16, 
            name:"Public Education Talk: Bone & Joint Health", 
            image: img16,
        },
        {
            id:17, 
            name:"Osteoarthritis & Cancer risk and treatment options", 
            image: img17,
        },
        {
            id:18, 
            name:"Fatty Liver Disease", 
            image: img18,
        },
        {
            id:19, 
            name:"Are You Suffering From Knee Pain?", 
            image: img19,
        },
        {
            id:20, 
            name:"Health & YOU 2014", 
            image: img20,
        },
    ];

    const eventList = events.map((event) =>(

        <div key={event.id}>
            <Col>
                <Link to="/">
                    {/* <div className="card mb-3 hoverable">
                        <div className="row no-gutters">
                            <div className="col-md-4">
                            <img src={event.image} className="card-img" alt={event.name}/>
                            </div>
                            <div className="col-md-8">
                                <div className="card-body">
                                    <h5 className="card-title">{event.name}</h5>
                                </div>
                            </div>
                        </div>
                    </div> */}

                    <div className="card" mb-3 hoverable>
                        <img src={event.image} className="card-img" alt={event.name}/>
                        <div className="card-body">
                            <h5 className="card-title">{event.name}</h5>
                        </div>
                    </div>

                </Link>
            </Col>
        </div>

    ));

    return(
        <>
            <div className="row past-events">
                <div className="col">
                    <h4>Past events</h4>
                    <Row xs={1} md={4} className="g-4">
                        {eventList}
                    </Row>
                </div>
            </div>
        </>
    );
}

export default PastEvents;
